const axios = require("axios")

const apiUrl = 'http://localhost:3000/test'

function getAllUsers(){
    axios.get(apiUrl)
    .then ((users) =>{
        console.log('users')
        if (!users) {
            throw new Error('Cannot get users')
        }
        return users
    })
    .catch((e) => {
        console.log('error')
        console.log(e)
    }) 
    // return 'getAllUsers function call'
}

function Login(){

    return (
        <div>
            <h1>Login</h1>
            <p>{getAllUsers()}</p>
        </div>
    )
}

export default Login
